import {
  View,
  Text,
  Image,
  TouchableOpacity,
} from "react-native";
import React, { useEffect, useState } from "react";
import { SafeAreaView } from "react-native-safe-area-context";
import * as ImagePicker from "expo-image-picker";
import * as FileSystem from "expo-file-system";
import {
  Ionicons, FontAwesome5,
} from "@expo/vector-icons";
import {
  GestureHandlerRootView,
  ScrollView,
  TextInput,
} from "react-native-gesture-handler";
import Toast from "react-native-toast-message";
import { api_url } from "../config";
import { useSelector } from "react-redux";

const WithdrawUSDTTRC = ({ navigation }) => {

  // const { userReducer } = useSelector((state) => state);
  const currentUser  = useSelector(
    (state) => state?.userReducer?.currentUser
  );

  return (
    <GestureHandlerRootView>
      <SafeAreaView style={{
        backgroundColor: "white",
        height: "100%"
      }}>
      <ScrollView style={{
        backgroundColor: "white",
        height: "100%"
      }}>
     <View
          style={{
            flexDirection: "row",
            justifyContent: "space-between",
            alignItems: "center",
          }}
        >
          <View
            style={{
              flexDirection: 'row',
              alignItems: 'center',
            }}
          >
            <Ionicons
            name="arrow-back-outline"
            size={30}
            color="black"
            style={{
              padding: 5,
              marginLeft: 10,
              marginTop: 10,
            }}
            onPress={() => navigation.navigate("Withdraw")}
          />
          <Text
            style={{
              padding: 5,
              marginLeft: 5,
              marginTop: 10,
              fontSize: 20,
              fontWeight: "bold",
            }}
          >
            Withdraw
          </Text>
          </View>
          <View
          style={{
            flexDirection: 'row',
            justifyContent: 'space-between',
          }}
        >
          </View>
          <View
          style={{
            flexDirection: 'row',
            justifyContent: 'space-between',
          }}
        >
          <View
            style={{
              flexDirection: 'row',
              alignItems: 'center',
            }}
          >
             <FontAwesome5
            name="history"
            size={25}
            color="black"
            style={{
              padding: 5,

            }}
            onPress={() => navigation.navigate("Deposithistory")}
          />
          </View>
          </View>
          </View>
      
        <View
          style={{
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          <GestureHandlerRootView>
          <View style={{
              paddingTop: 20,
            }}>
          <Text
            style={{
              fontSize: 15,
              color: "gray",
            }}
          >
            Network
          </Text>
        </View>
        <View style={{
                flexDirection: "row",
                alignSelf: "center",
                paddingBottom: 8,
                  borderWidth: 1,
                  width: 400,
                  padding: 10,
                  marginTop: 10,
                  gap: 5,
              }}>
                <Image
            source={require("../assets/USDT.png")}
            style={{
              alignItems: "center",
              height: 30,
              width: 30,
            }}
          />
          <Text 
            style={{
              fontWeight: "500",
              fontSize: 20,
              color: "black"
            }}
            editable={false}>USDT-TRC</Text>
          </View>
          <View style={{
            paddingTop: 20
          }}>
          <Text
            style={{
              fontSize: 15,
              color: "gray",
            }}
          >
          Amount
          </Text>
        </View>
            <TextInput
              style={{
                borderWidth: 1,
                width: 400,
                padding: 15,
                marginTop: 10,
                alignSelf: "center"
              }}
              placeholder="Enter Withdraw Amount"
              value={depositAmount}
              onChangeText={(text) => setDepositAmount(text)}
              keyboardType="numeric"
            />
            <View style={{
            paddingTop: 20
          }}>
          <Text
            style={{
              fontSize: 15,
              color: "gray",
            }}
          >
          Address
          </Text>
        </View>
            <TextInput
              style={{
                borderWidth: 1,
                width: 400,
                padding: 15,
                marginTop: 10,
                alignSelf: "center"
              }}
              placeholder="Enter Wallet Address"
              value={depositAmount}
              onChangeText={(text) => setDepositAmount(text)}
              keyboardType="numeric"
            />
            <View style={{
            paddingTop: 20
          }}>
          <Text
            style={{
              fontSize: 15,
              color: "gray",
            }}
          >
          Password
          </Text>
        </View>
            <TextInput
              style={{
                borderWidth: 1,
                width: 400,
                padding: 15,
                marginTop: 10,
                alignSelf: "center"
              }}
              placeholder="Enter Fund Password"
              value={depositAmount}
              onChangeText={(text) => setDepositAmount(text)}
              keyboardType="numeric"
            />
             <View style={{
            paddingTop: 20,
          }}>
          <Text
            style={{
              fontSize: 15,
              color: "gray",
              paddingBottom: 10,
              paddingLeft: 10
            }}
          >
          Tips
          </Text>
          <Text
            style={{
              fontSize: 15,
              color: "gray",
              paddingHorizontal: 10
              
            }}
          >
          Please note that a handling fee will be applied for cash withdrawls, and it may take up to 24 hours for the funds to arrive in your account. If you have any questions, please feel free to contact our customer service team.
          </Text></View>
          <View style={{
            paddingTop: 20,
            flexDirection: 'row',
            paddingHorizontal: 10,
            gap: 2
          }}>
          <Text
            style={{
              fontSize: 15,
              color: "gray",
              paddingBottom: 10
            }}
          >
          Handling Fee: 
          </Text>
          <Text
            style={{
              fontSize: 15,
              color: "black",
              fontWeight: "600"
            }}
          >
          2%
          </Text></View>
          </GestureHandlerRootView>
        </View>
            
        
        <TouchableOpacity
          style={{
            flexDirection: "row",
            justifyContent: "center",
            alignItems: "center",
            alignSelf: "center",
            padding: 10,
            backgroundColor: "aqua",
            borderRadius: 25,
            width: 200,
            marginTop: 20,
            marginBottom: "5%",
          }}
          onPress={handleWithdraw}
        >
          <Text style={{ color: "white", marginRight: 5 }}>Confirm Withdraw</Text>
        </TouchableOpacity>
      
      </ScrollView>
      </SafeAreaView>
    </GestureHandlerRootView>
  );
};

export default WithdrawUSDTTRC;
